  false,\n\t\"url\": null,\n\t\"notes\": \"In preparation for bottom sediment coring
  at Mother Goose Lake, bathymetric data was collected using a Lowrance Sonar \"fishfinder\"
  (model LcX-17M) in August 2006 and August 2007. A 5-meter bathymetric contour map
  of the lake bottom was constructed using the GPS-sonar data in conjunction with
  field observations. The contour data and GPS location and depth data are provided
  in ESRI shapefile format for use in Geographic Information System (GIS) software.\",\n\t\"license_title\":
